import React, { Component, useEffect } from 'react';
import { Navigate } from 'react-router-dom';

export default class UserSignOut extends Component ({ context }) {
  render () {
    useEffect(() =>  context.actions.signOut());

  return (
    <Navigate to="/" />
  );
}
}
